import "./App.css";
import HomePage from "./Pages/Home_page/Home_page";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { PizzaListPage } from "./utils";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} /> {}
        <Route path="/pizza-list" element={<PizzaListPage />} /> {/* Маршрут для списка пиццы */}
      </Routes>
    </Router>
  );
}

export default App;
